    "2016-01-28T07:20:25.840636",nt"name": "boundaries-special-service-areas-kml-deprecated-november-2013",nt"isopen":
    false,nt"url": null,nt"notes": "KML files of Special Service Areas (SSA)
    boundaries in Chicago. To view or use these files, special GIS software such a Google
    Earth is required. The Special Service Area program is a mechanism used to fund
    expanded services and programs through a localized property tax levy within contiguous
    industrial, commercial and residential areas. The enhanced services and programs
    are in addition to services and programs currently provided through the city. SSA-funded
    projects could include, but are not limited to, security services, area marketing
    and advertising assistance, promotional activities such as parades and festivals,
    or any variety of small scale capital improvements that could be supported through
    a modest property tax levy.",nt"license_title": "License Not Specified",nt"extras":
